import React from 'react';

class Tile extends React.Component {
  constructor(props) {
    super(props);
    this.row = props.row;
    this.col = props.col;
    this.type = props.type;
    this.title = props.title;
    this.title = "henlo";
    this.info = props.info;
    this.highlight = props.highlight;
    this.handleDrop = props.drop;
    this.handleDrag = this.handleDrag.bind(this);
    this.handleDragOver = this.handleDragOver.bind(this);
  }

  handleDrag(e) {
    console.log(e.target);
    //e.dataTransfer.setData()
  }

  handleDragOver(e) {
    e.preventDefault();
  }

  render() {
    return (
      <div draggable="true" onDragOver={this.handleDragOver} onDragStart={this.handleDrag}
        onDrop={this.handleDrop} className="grid-tile">hi</div>
    )
  }
}

export default Tile
